        <Container fluid className="vh-100 ">
            <Container className="justify-content-center d-flex flex-column">
                <h1 className="text-login">Login</h1>
                <p>Sign in to VibraGram for more fun</p>
            </Container>
        </Container>
    )
}

export default LoginLayout
